import './navbar.css'
import React from 'react';
import {Nav, Navbar, Container} from 'react-bootstrap';



const Menu = () => {
    return(
        <Navbar expand="lg" bg="success" variant="dark" className="nav-bar">
            <Container>
            <Navbar.Brand>Mapeo Huertos Urbanos</Navbar.Brand>
            <Nav className="menu-items">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/">Mapa</Nav.Link>
            <Nav.Link href="/">Contacto</Nav.Link>
            </Nav>
            </Container>
        </Navbar>
    );
}

export default Menu;
